CREATE PROCEDURE `GenerateInvoice`()
BEGIN
INSERT INTO JobInvoice
  (JobContractID, 
  JobID, 
  BusinessID, 
  Description, 
  InvoiceDate, 
  InvoiceAmt, 
  Tax, 
  SalesPerson_EmployeeID, 
  CommissionAmt, 
  EmployeeID, 
  EmployeeAmt, 
  ActualDate, 
  StartTime, 
  EndTime, 
  StartMiles, 
  EndMiles, 
  Created)
SELECT 
  JobContractID, 
  JobID, 
  BusinessID, 
  Description, 
  sysdate(),
  ChargeAmt, 
  Tax,
  SalesPerson_EmployeeID, 
  CommissionAmt, 
  EmployeeID, 
  EmployeeAmt, 
  ActualDate, 
  ActualStartTime, 
  ActualEndTime, 
  ActualStartMiles, 
  ActualEndMiles,
  sysdate()
FROM JobList
WHERE 
  not (JobCancelled)
   and (Invoiced)
   and (JobCompleted);
UPDATE JobList a
SET Invoiced = 1
WHERE   
  not (JobCancelled)
   and (Invoiced)
   and (JobCompleted)
   AND
EXISTS(SELECT JobInvoiceID 
    FROM JobInvoice b
    WHERE b.JobID = a.JobID);
END;


CREATE PROCEDURE `GenerateJobs`()
BEGIN

  DECLARE done BOOLEAN DEFAULT 0;
  DECLARE JCID INT;
  DECLARE TJobs INT;
  DECLARE FSec INT;
  DECLARE Cnt INT;
  DECLARE SDate DATETIME; 
  DECLARE sqls varchar(500);
  DECLARE cur1 CURSOR FOR 
select 
    JobContractID, TotalJobs, FreqInSec, StartDate
FROM JobContract a
where Confirmed = 1
and not exists(
    select JobContractID from JobList b
    where a.JobContractID = b.JobContractID);
    
  DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;    
  
  OPEN cur1;
  
  REPEAT
    FETCH cur1 INTO JCID, TJobs, FSec, SDate;  
    IF NOT done THEN                         
    set Cnt= 0;        
      WHILE TJobs > Cnt DO    
         SET Cnt = Cnt + 1;     

insert into JobList
   (JobContractID, 
   RequestedJobDate, 
   BusinessID, 
   BusinessLocation, 
   ContactName, 
   ContactPhone, 
   PickupLocation, 
   DropOffLocation, 
   FinalDropOffLocation, 
   PickupTime, 
   DropOffTime, 
   NumberOfItems, 
   Description, 
   Budget, 
   SpecialInstructions, 
   RequestDate, 
   Hours, 
   Quote, 
   EmployeeID, 
   EmployeeAmt, 
   SalesPerson_EmployeeID, 
   CommissionAmt)
select 
    JobContractID,   
    DATE_ADD(SDate, INTERVAL (FSec * CNT) SECOND),
    BusinessID, 
    BusinessLocation, 
    ContactName, 
    ContactPhone, 
    PickupLocation, 
    DropOffLocation, 
    FinalDropOffLocation, 
    PickupTime, 
    DropOffTime, 
    NumberOfItems, 
    Description, 
    Budget, 
    SpecialInstructions, 
    ContractDate,
    Hours, 
    Quote, 
    EmployeeID, 
    EmployeeAmt, 
    SalesPerson_EmployeeID, 
    CommissionAmt
    from JobContract
    where JobContractID = JCID;

      END WHILE;   
      
   END IF;
  UNTIL done END REPEAT;

  CLOSE cur1;

END;

