CREATE TRIGGER trEmployeeBI BEFORE INSERT ON Employee FOR EACH ROW
begin
if new.EmployeeNum is null then 
set new.EmployeeNum =  
(SELECT AUTO_INCREMENT FROM information_schema.TABLES WHERE
TABLE_SCHEMA = DATABASE() AND TABLE_NAME = 'Employee');
 end if;
 if new.YearSalary is null then set new.YearSalary = new.HourlyRate * 2080;
 end if;                     
 if new.HourlyRate is null then set new.HourlyRate = new.YearSalary / 2080;
 end if;
 if new.Created is null then set new.Created = sysdate(); end if;
 end ;

CREATE TRIGGER trEmployeeBU BEFORE UPDATE ON Employee FOR EACH ROW
Begin
if new.TerminationDate is not null  and new.TerminationDate <= sysdate() then
set new.Active = 0 ;    
end if;
if new.HourlyRate = 0 or new.HourlyRate is null then set new.HourlyRate = 
new.YearSalary / 2080; end if;
if new.YearSalary = 0 or new.YearSalary is null then set new.YearSalary =
new.HourlyRate * 2080; end if;
End ;

