CREATE TRIGGER trEventBI BEFORE INSERT ON Event FOR EACH ROW
begin
    declare logstatus tinyint;
    if new.StatusChgInd > 0 THEN
        begin
            select ClockedIn into logstatus from Login where EmployeeID = new.EmployeeID;
            if logstatus = 0 then
                begin
                    set new.StatusChgTo = 1;
                    update Login set ClockedIn = 1 where EmployeeID = new.EmployeeID;
                end;
            else
                begin
                    set new.StatusChgTo = 0;
                    update Login set ClockedIn = 0 where EmployeeID = new.EmployeeID;
                end;
            end if;
        end;      
    end if;
end ;

